import styled from "styled-components";

export const SWContainer = styled.div`
  height: 500px;
  width: 800px;
  padding: 10%;
`;

export const SWTitleContainer = styled.div`
  outline: 2px solid #ffffff;
  display: grid;
  grid-template-columns: 1fr 1fr;
  grid-gap: 1px;

  justify-content: center;
`;

export const SWTitleDiv1 = styled.div`
  width: 50%;
  float: left;
`;

export const SWTitleDiv2 = styled.div`
  width: 50%;
  float: left;
`;

export const SWBodyContainer = styled.div`
  height: 500px;
  width: 800px;
  padding: 10%;
  display: flex;
  flex-direction: row;
  outline: 2px solid #ffffff;
`;
